import React from "react";
import Home from "./Pages/Home";
import { BrowserRouter, Router, Route } from "react-router-dom";

function Routes() {
  return (
    <>
      <BrowserRouter>
        <Router>
          <Route path={'/home'}>
            <Home />
          </Route>
        </Router>
      </BrowserRouter>
    </>
  );
}

export default Routes;
